import React from 'react';
function sum(a,b){
    return a+b;
}
function mul(a,b){
    return a*b;
}
function div(a,b){
    return Math.trunc();
}
function sub(a,b){
    return Math.abs(a-b);
}
export default sum;
export {mul,div,sub};
